import React, { Component } from "react";

export default class Home extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: ""
    };
  }

  render() {
    return (
      <div className="container" >
        <header className="jumbotron">
        <h5>Welcome to this simple react projects!</h5>
        <img src="https://1.bp.blogspot.com/-XUF2da-sFe0/XkAOMbn11LI/AAAAAAAAFGM/RPYIEle5vLkockeKrMci6YnIqBwLxi5swCLcBGAsYHQ/s1600/Your%2BCompany%2BName-4.png" class="img-fluid"></img>
        </header>
      </div>
    );
  }
}
